module.exports = (input, quantity = 3) => {
    return [{ title: 'startpage.com know we\'re a robot now :('}]
    const { window, document } = fetchSync.dom('http://www.startpage.com/do/search?query=' + encodeURIComponent(input));

    return [...document.querySelectorAll('.w-gl__result')]
        .slice(0, quantity)
        .map(node => {
            const title = node.querySelector('h3').textContent.trim();
            const url = node.querySelector('.result-link').href;
            const description = node.querySelector('p').textContent;
            return ({ title, url, description });
        });
};
